import React from "react";

const Image_preview = ({ Images, OnChange }) => {
  <div class="ui tiny images">
    <img
      class="ui image"
      src="https://upload.wikimedia.org/wikipedia/en/2/2f/Jerry_Mouse.png"
    />
  </div>;
};

export default Image_preview;
